import React from "react";
import { Link } from "react-router-dom";
// reactstrap components
import {
  Col,
  Row,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  NavbarBrand,
  UncontrolledCollapse,
  Navbar,
  NavItem,
  NavLink,
  Nav,
  Container,
} from "reactstrap";

function HomeNavbar() {
  const [navbarColor, setNavbarColor] = React.useState("navbar-transparent");
  const [collapseOpen, setCollapseOpen] = React.useState(false);
  React.useEffect(() => {
    const updateNavbarColor = () => {
      if (
        document.documentElement.scrollTop > 399 ||
        document.body.scrollTop > 399
      ) {
        setNavbarColor("");
      } else if (
        document.documentElement.scrollTop < 400 ||
        document.body.scrollTop < 400
      ) {
        setNavbarColor("navbar-transparent");
      }
    };
    window.addEventListener("scroll", updateNavbarColor);
    return function cleanup() {
      window.removeEventListener("scroll", updateNavbarColor);
    };
  });
  return (
    <>
      {collapseOpen ? (
        <div
          id="bodyClick"
          onClick={() => {
            document.documentElement.classList.toggle("nav-open");
            setCollapseOpen(false);
          }}
        />
      ) : null}
        {/* <Navbar className={"navbar-light fixed-top " + navbarColor} expand="lg"> */}
        <Navbar className="navbar-light bg-info mt-4" style={{fontFamily: "font-family: 'poppins-bold', sans-serif !important;"}} expand="lg">
            <Container fluid>
              <button className="navbar-toggler" id="navbar-info">
                <span className="navbar-toggler-icon">
                <i class="fa fa-bars" aria-hidden="true"></i>
                </span>
              </button>
              <UncontrolledCollapse navbar toggler="#navbar-info">
                <div className="navbar-collapse-header">
                </div>
                <Nav className="mr-auto" navbar>
                <NavItem>
                    <NavLink
                      className="nav-link-icon"
                      to="/admin/dashboard"
                      tag={Link}
                    >
                      <span className="nav-link-inner--text">Dashboard</span>
                    </NavLink>
                  </NavItem>
                  <UncontrolledDropdown nav>
                    <DropdownToggle nav>
                      <i className="ni ni-collection d-lg-none mr-1" />
                      <span className="nav-link-inner--text">Bookings</span>
                    </DropdownToggle>
                    <DropdownMenu>
                      <DropdownItem to={{ 
                        pathname: '/admin/bookings', state: { bookingcategory: 'pending'} 
                        }} tag={Link}>
                        Pending
                      </DropdownItem>
                      <DropdownItem to={{ 
                        pathname: '/admin/bookings', state: { bookingcategory: 'upcoming'} 
                        }} tag={Link}>
                        Upcoming
                      </DropdownItem>
                      <DropdownItem to={{ 
                        pathname: '/admin/bookings', state: { bookingcategory: 'past'} 
                        }} tag={Link}>
                        Past
                      </DropdownItem>
                    </DropdownMenu>
                  </UncontrolledDropdown>
                  <NavItem>
                    <NavLink
                      className="nav-link-icon"
                      to="/admin/services"
                      tag={Link}
                    >
                      <span className="nav-link-inner--text">Services</span>
                    </NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink
                      className="nav-link-icon"
                      to="/admin/settings"
                      tag={Link}
                    >
                      <span className="nav-link-inner--text">Settings</span>
                    </NavLink>
                  </NavItem>
                </Nav>
                <Nav className="ml-auto" navbar>

                </Nav>
              </UncontrolledCollapse>
            </Container>
          </Navbar>
    </>
  );
}

export default HomeNavbar;
